import React from "react";
import { motion } from "framer-motion";
import "../HomeScreen/HomeScreen.css";

function Backdrop() {
  return (
    <motion.div
      initial={{ opacity: 1, zIndex: 5 }}
      animate={{
        opacity: 0,
        zIndex: 0,
        transition: { duration: 0.5, delay: 10 },
      }}
      className="backdrop"
    >
      <h1>
        Ani<strong>My</strong>Site
      </h1>
    </motion.div>
  );
}

export default Backdrop;
